import React, { useState } from "react";
import styled from "styled-components";
import { jsPDF } from "jspdf";

const dummyData = [
  { name: "John Doe", score: 85, details: "CEO of XYZ Corp. Known for innovation and leadership." },
  { name: "Jane Smith", score: 92, details: "Renowned lawyer with a strong track record in corporate law." },
  { name: "Emily Davis", score: 78, details: "Tech entrepreneur with several successful startups." },
];

const App = () => {
  const [searchTerm, setSearchTerm] = useState("");
  const [results, setResults] = useState([]);

  const handleSearch = () => {
    const filteredData = dummyData.filter((person) =>
      person.name.toLowerCase().includes(searchTerm.toLowerCase())
    );
    setResults(filteredData);
  };

  const handleDownloadPDF = (person) => {
    const doc = new jsPDF();

    // Add content to the PDF
    doc.setFontSize(16);
    doc.text(`Person Details`, 10, 10);
    doc.setFontSize(12);
    doc.text(`Name: ${person.name}`, 10, 20);
    doc.text(`Score: ${person.score}`, 10, 30);
    doc.text(`Details: ${person.details}`, 10, 40);

    // Save the PDF
    doc.save(`${person.name.replace(/\s+/g, "_")}_Details.pdf`);
  };

  return (
    <Wrapper>
      <Navbar>
        <NavLogo>DDMaximos</NavLogo>
        <NavItems>
          <NavItem>Home</NavItem>
          <NavItem>About</NavItem>
          <NavItem>Contact</NavItem>
        </NavItems>
      </Navbar>

      <MainSection>
        <SearchContainer>
          <SearchTitle>Discover a Person</SearchTitle>
          <SearchInput
            type="text"
            placeholder="Enter a name..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />
          <SearchButton onClick={handleSearch}>Search</SearchButton>
        </SearchContainer>

        <ResultsContainer>
          {results.length === 0 ? (
            <NoResults>No results found. Try searching for someone!</NoResults>
          ) : (
            results.map((person, index) => (
              <ResultCard key={index}>
                <CircularScore score={person.score}>
                  <ScoreText>{person.score}</ScoreText>
                </CircularScore>
                <ResultContent>
                  <ResultName>{person.name}</ResultName>
                  <ResultDetails>{person.details}</ResultDetails>
                  <DownloadButton onClick={() => handleDownloadPDF(person)}>
                    Download Info as PDF
                  </DownloadButton>
                </ResultContent>
              </ResultCard>
            ))
          )}
        </ResultsContainer>
      </MainSection>

      <Footer>
        <FooterText>Â© 2025 DDMaximos. All rights reserved.</FooterText>
      </Footer>
    </Wrapper>
  );
};

export default App;


export const DownloadButton = styled.button`
  margin-top: 1rem;
  padding: 0.7rem 1.5rem;
  font-size: 1rem;
  color: white;
  background: #3498db;
  border: none;
  border-radius: 8px;
  cursor: pointer;
  transition: background 0.3s ease;
  &:hover {
    background: #2980b9;
  }
`;

// Wrapper and Layout
export const Wrapper = styled.div`
  font-family: "Arial", sans-serif;
  color: #333;
  display: flex;
  flex-direction: column;
  min-height: 100vh;
`;

export const Navbar = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
  background: #34495e;
  padding: 1rem 2rem;
  color: white;
`;

export const NavLogo = styled.h1`
  font-size: 1.8rem;
  font-weight: bold;
`;

export const NavItems = styled.div`
  display: flex;
  gap: 2rem;
`;

export const NavItem = styled.div`
  cursor: pointer;
  transition: color 0.3s ease;
  &:hover {
    color: #1abc9c;
  }
`;

export const MainSection = styled.main`
  flex: 1;
  padding: 2rem;
  display: flex;
  flex-direction: column;
  align-items: center;
  background: linear-gradient(135deg, #ecf0f1, #bdc3c7);
`;

// Search Section
export const SearchContainer = styled.div`
  text-align: center;
  margin-bottom: 3rem;
`;

export const SearchTitle = styled.h2`
  font-size: 2.5rem;
  margin-bottom: 1.5rem;
  color: #2c3e50;
`;

export const SearchInput = styled.input`
  width: 350px;
  padding: 0.8rem;
  border: 2px solid #2c3e50;
  border-radius: 8px;
  font-size: 1.1rem;
  margin-right: 1rem;
  transition: border-color 0.3s ease;
  &:focus {
    border-color: #1abc9c;
    outline: none;
  }
`;

export const SearchButton = styled.button`
  padding: 0.8rem 1.8rem;
  font-size: 1.1rem;
  color: white;
  background: #1abc9c;
  border: none;
  border-radius: 8px;
  cursor: pointer;
  transition: background 0.3s ease;
  &:hover {
    background: #16a085;
  }
`;

// Results Section
export const ResultsContainer = styled.div`
  width: 100%;
  max-width: 800px;
  display: flex;
  flex-direction: column;
  gap: 2rem;
`;

export const ResultCard = styled.div`
  display: flex;
  align-items: center;
  padding: 1rem;
  border: 1px solid #2c3e50;
  border-radius: 10px;
  background: white;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
  gap: 1.5rem;
`;

export const CircularScore = styled.div`
  width: 100px;
  height: 100px;
  border-radius: 50%;
  background: conic-gradient(
    ${({ score }) =>
      score > 80
        ? "#1abc9c 0% " + score + "%"
        : score > 60
        ? "#f39c12 0% " + score + "%"
        : "#e74c3c 0% " + score + "%"},
    #ecf0f1 ${props => props.score}% 100%
  );
  display: flex;
  justify-content: center;
  align-items: center;
  font-size: 1.5rem;
  font-weight: bold;
  color: white;
`;

export const ScoreText = styled.div`
  font-size: 1.2rem;
  font-weight: bold;
`;

export const ResultContent = styled.div`
  flex: 1;
`;

export const ResultName = styled.h3`
  font-size: 1.5rem;
  color: #2c3e50;
`;

export const ResultDetails = styled.p`
  font-size: 1rem;
  color: #7f8c8d;
`;

export const NoResults = styled.p`
  font-size: 1.2rem;
  color: #7f8c8d;
  text-align: center;
`;

// Footer
export const Footer = styled.footer`
  background: #34495e;
  color: white;
  text-align: center;
  padding: 1rem;
`;

export const FooterText = styled.p`
  font-size: 0.9rem;
  margin: 0;
`;
